import tkinter as tk
import controller as c

# картинки в бинарном коде
sergey = b''
sergey_thug = b''
python = b''
python_thug = b''
empty = b''
BG = b''

# создание окна программы
xo = tk.Tk()
xo.geometry(f'302x410+300+100')
xo.resizable(False, False)
xo.title('Сергей - Питон')

# создание объектов tk.PhotoImage из бинарного кода
O = tk.PhotoImage(data=sergey, format='png')
O_thug = tk.PhotoImage(data=sergey_thug, format='png')
X = tk.PhotoImage(data=python, format='png')
X_thug = tk.PhotoImage(data=python_thug, format='png')
space = tk.PhotoImage(data=empty, format='png')
bg = tk.PhotoImage(data=BG, format='png')

# создание и размещение плашки с логотипом
pict = tk.Label(xo, image=bg)
pict.grid(row=4, column=0, columnspan=3)

# информационная панель, поле ввода имени и кнопка ввода
dashboard = tk.Label(xo, text='Ваше имя:')
game_dashboard = None
entry = tk.Entry(xo, width=10)
start_btn = tk.Button(text='Начать', command=lambda: c.start_game(entry.get()))
restart_button = None
dashboard.grid(row=0, column=0)
entry.grid(row=0, column=1)
start_btn.grid(row=0, column=2)

# кнопки основного поля игры
buttons = [tk.Button(image=space, command=lambda i=i: c.get_move(i)) for i in range(9)]

index = 0
for row in range(1, 4):
    for column in range(3):
        buttons[index].grid(row=row, column=column, stick='wens')
        index += 1

xo.grid_columnconfigure(0, minsize=100)
xo.grid_columnconfigure(1, minsize=100)
xo.grid_columnconfigure(2, minsize=100)
xo.grid_rowconfigure(0, minsize=0)
xo.grid_rowconfigure(1, minsize=100)
xo.grid_rowconfigure(2, minsize=100)
xo.grid_rowconfigure(3, minsize=100)

player_name = None


def update_dashboard(name):
    """Обновление информационной панели в начале игры"""

    dashboard.destroy()
    entry.destroy()
    start_btn.destroy()
    global game_dashboard, restart_button, player_name
    player_name = name
    game_dashboard = tk.Label(xo, width=22, text=f'{name}, Ваш ход.')
    game_dashboard.grid(row=0, column=0, columnspan=2)
    restart_btn = tk.Button(text='Заново', command=lambda: c.start_game(name))
    restart_btn.grid(row=0, column=2)
    c.game.game_field = [space] * 9


def update_buttons(game_field):
    """Обновляет изображения на игровых кнопках"""

    for i in range(len(buttons)):
        buttons[i]['image'] = game_field[i]


def highlight_winner(mark, combination):
    """Выделяет победну комбинацию, заменяя изображения в соответствующих кнопках"""

    for i in combination:
        if mark == O:
            c.game.game_field[i] = O_thug
        else:
            c.game.game_field[i] = X_thug
    update_buttons(c.game.game_field)


def announce_winner(winner='Пластмассовый мир'):
    """Объявляет результаты игры"""

    game_dashboard['text'] = f'{winner} победил!'
    if winner == 'ничья':
        game_dashboard['text'] = f'Ничья!'
